import React from "react";

export default function Readuser() {
  return (
    <div className="row ">
      <div className="col-md-4 offset-md-4 mb-3 mt-4 border rounded shadow">
        <h1>View User</h1>
        <div className="col mb-3 border rounded">
            <b>Name:</b>
        </div>
      </div>
    </div>
  );
}
